import NavLink from './nav-link';

const links = [
  {
    title: 'bit lore',
    path: '/'
  },
  {
    title: 'about',
    path: '/about'
  },
  {
    title: 'work',
    path: '/work'
  },
  {
    title: 'contact',
    path: '/contact'
  }
];

const navItems = links.map( link => NavLink(link.title, link.path) );

const Header = () => (
  <nav>
    {navItems}
    <style jsx>{`
      nav {
      	display: flex;
      	justify-content: space-between;
      	margin: 0 auto;
      	height: 2em;
      	line-height: 2em;
      }

      @media only screen and (max-width:600px) {
      	nav {
      		text-align: center;
      	}
      }
    `}</style>
  </nav>
);

export default Header;
